import NavSingle from "./NavSingle";

function Footer() {
    return (
        <div>
            <ul>
                <NavSingle Title="Home" Link="../public/index.html" />
                <NavSingle Title="About" Link="../public/index.html" />
            </ul>
        </div>
    );
}

export default Footer;
